"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[7336],{7474:e=>{e.exports=JSON.parse('{"tag":{"label":"LeetCode","permalink":"/problem-solving/tags/leet-code","allTagsPath":"/problem-solving/tags","count":12,"items":[{"id":"LeetCode/Container With Most Water/README","title":"11. Container With Most Water","description":"You are given an integer array height of length n. There are n vertical lines drawn such that the two endpoints of the ith line are (i, 0) and (i, height[i]).Find two lines that together with the x-axis form a container, such that the container contains the most water.Return the maximum amount of water a container can store.Notice that you may not slant the container.","permalink":"/problem-solving/LeetCode/Container With Most Water/"},{"id":"LeetCode/Final Value of Variable After Performing Operations/README","title":"2011. Final Value of Variable After Performing Operations","description":"There is a programming language with only four operations and one variable X. Given an array of strings operations containing a list of operations, return the final value of X after performing all the operations.","permalink":"/problem-solving/LeetCode/Final Value of Variable After Performing Operations/"},{"id":"LeetCode/Minimum Size Subarray Sum/README","title":"209. Minimum Size Subarray Sum","description":"Given an array of positive integers nums and a positive integer target, return the minimal length of a subarray whose sum is greater than or equal to target. If there is no such subarray, return 0 instead.","permalink":"/problem-solving/LeetCode/Minimum Size Subarray Sum/"},{"id":"LeetCode/Adjacent Increasing Subarrays Detection I/README","title":"3349. Adjacent Increasing Subarrays Detection I","description":"Given an array nums of n integers and an integer k, determine whether there exist two adjacent subarrays of length k such that both subarrays are strictly increasing. Specifically, check if there are two subarrays starting at indices a and b (a < b)","permalink":"/problem-solving/LeetCode/Adjacent Increasing Subarrays Detection I/"},{"id":"LeetCode/Adjacent Increasing Subarrays Detection II/README","title":"3350. Adjacent Increasing Subarrays Detection II","description":"Given an array nums of n integers, your task is to find the maximum value of k for which there exist two adjacent subarrays of length k each, such that both subarrays are strictly increasing. Specifically, check if there are two subarrays of length k starting at indices a and b (a < b)","permalink":"/problem-solving/LeetCode/Adjacent Increasing Subarrays Detection II/"},{"id":"LeetCode/Maximum Number of Distinct Elements After Operations/README","title":"3397. Maximum Number of Distinct Elements After Operations","description":"You are given an integer array nums and an integer k.You are allowed to perform the following operation on each element of the array at most once:Add an integer in the range [-k, k] to the element.Return the maximum possible number of distinct elements in nums after performing the operations.","permalink":"/problem-solving/LeetCode/Maximum Number of Distinct Elements After Operations/"},{"id":"LeetCode/Check If Digits Are Equal in String After Operations I/README","title":"3461. Check If Digits Are Equal in String After Operations I","description":"You are given a string s consisting of digits. Perform the following operation repeatedly until the string has exactly two digits:For each pair of consecutive digits in s, starting from the first digit, calculate a new digit as the sum of the two digits modulo 10. Replace s with the sequence of newly calculated digits, maintaining the order in which they are computed. Return true if the final two digits in s are the same; otherwise, return false.","permalink":"/problem-solving/LeetCode/Check If Digits Are Equal in String After Operations I/"},{"id":"LeetCode/Intersection of Two Arrays/README","title":"349. Intersection of Two Arrays","description":"Given two integer arrays nums1 and nums2, return an array of their intersection. Each element in the result must be unique and you may return the result in any order.","permalink":"/problem-solving/LeetCode/Intersection of Two Arrays/"},{"id":"LeetCode/Ransom Note/README","title":"383. Ransom Note","description":"Given two strings ransomNote and magazine, return true if ransomNote can be constructed by using the letters from magazine and false otherwise.","permalink":"/problem-solving/LeetCode/Ransom Note/"},{"id":"LeetCode/Is Subsequence/README","title":"392. Is Subsequence","description":"Given two strings s and t, return true if s is a subsequence of t, or false otherwise.","permalink":"/problem-solving/LeetCode/Is Subsequence/"},{"id":"LeetCode/Fibonacci Number/README","title":"509. Fibonacci Number","description":"The Fibonacci numbers, commonly denoted F(n) form a sequence, called the Fibonacci sequence, such that each number is the sum of the two preceding ones, starting from 0 and 1.","permalink":"/problem-solving/LeetCode/Fibonacci Number/"},{"id":"LeetCode/Binary Search/README","title":"704. Binary Search","description":"Given an array of integers nums which is sorted in ascending order, and an integer target, write a function to search target in nums. If target exists, then return its index. Otherwise, return -1. You must write an algorithm with O(log n) runtime complexity.","permalink":"/problem-solving/LeetCode/Binary Search/"}],"unlisted":false}}')}}]);